import React, { useEffect, useState } from "react";
import { styled } from "@mui/system";
import { Pagination } from '@mui/material';
import {
    Container,
    createTheme,
    TableCell,
    LinearProgress,
    ThemeProvider,
    Typography,
    TextField,
    TableBody,
    TableRow,
    TableHead,
    Table,
    Paper,
    TableContainer,
} from "@mui/material";
import axios from "axios";
import { CoinList } from "../config/api";
import { CryptoState } from "../CryptoContext";
import { useNavigate } from "react-router-dom"; 
import { numberWithCommas } from "./Banner/Carousal";
import "./CoinsTable.css"


// Define your styled components
const StyledContainer = styled(Container)({
    textAlign: "center",
    backgroundColor : "fff",
    backgroundSize: "cover",

});

const StyledTableContainer = styled(TableContainer)({
    marginBottom: 0,
});

const StyledTextField = styled(TextField)({
    marginBottom: 20,
    width: "100%",
});

const StyledTableHead = styled(TableHead)({
    backgroundColor: "FFE382",
});

const StyledTableRow = styled(TableRow)({
    backgroundColor: "#16171a",
    cursor: "pointer",
    "&:hover": {
        backgroundColor: "#131111",
    },
    fontFamily: "Montserrat",
});

const StyledPagination = styled(Pagination)({
    padding: 20,
    width: "100%",
    display: "flex",
    justifyContent: "center",
});


const CoinsTable = () => {
    const [coins, setCoins] = useState([]);
    const [loading, setLoading] = useState(false);
    const [search, setSearch] = useState("");
    const [page, setPage] = useState(1);

    const { currency, symbol } = CryptoState();

    const darkTheme = createTheme({
      palette: {
        primary: {
          main: "#fff",
        },
        type: "light",
      },
    });

    const fetchCoins = async () => {
      try {
        setLoading(true);
        const { data } = await axios.get(
          '/api/v3/coins/markets?vs_currency=INR&order=gecko_desc&per_page=10&page=1&sparkline=false&price_change_percentage=24h'
        );
        console.log(data);
        setCoins(data);
      } catch (error) {
        console.error("Error fetching coins:", error);

        if (axios.isAxiosError(error)) {
          if (error.response && error.response.status === 429) {
            console.error("Rate-limiting error. Too many requests.");
            // Handle rate-limiting error (e.g., display a user-friendly message)
          } else {
            console.error("Unexpected error:", error);
            // Handle other types of errors
          }
        }
      } finally {
        setLoading(false);
      }
    };

    useEffect(() => {
      fetchCoins();
      // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [currency]);

    const navigate = useNavigate();

    const handleSearch = () => {
      return coins.filter(
        (coin) =>
          coin.name.toLowerCase().includes(search) ||
          coin.symbol.toLowerCase().includes(search)
      );
    };

    return (
      <ThemeProvider theme={darkTheme}>
        <StyledContainer>
          <Typography variant="h4" sx={{ margin: 18, fontFamily: "Montserrat" }}>
            Cryptocurrency Prices by Market Cap
          </Typography>
          <StyledTextField
            label="Search For a Crypto Currency.."
            variant="outlined"
            onChange={(e) => setSearch(e.target.value)}
          />
          <StyledTableContainer component={Paper}>
            {loading ? (
              <LinearProgress sx={{ backgroundColor: "#FFE382" }} />
            ) : (
              <Table aria-label="simple table">
                <StyledTableHead>
                  <TableRow className="table">
                    {["Coin", "Price", "24h Change", "Market Cap"].map((head) => (
                      <TableCell
                        sx={{
                          color: "black",
                          fontWeight: "700",
                          fontFamily: "Montserrat",
                        }}
                        key={head}
                        align={head === "Coin" ? "center" : "right"}
                      >
                        {head}
                      </TableCell>
                    ))}
                  </TableRow>
                </StyledTableHead>

                <TableBody>
                  {handleSearch().map((row) => {
                    const profit = row.price_change_percentage_24h > 0;
                    return (
                      <StyledTableRow
                        onClick={() => navigate(`/coins/${row.id}`)}
                        key={row.name}
                      >
                        {/* ... (rest of the code) */}
                      </StyledTableRow>
                    );
                  })}
                </TableBody>
              </Table>
            )}
          </StyledTableContainer>

          <StyledPagination
            count={(handleSearch()?.length / 10).toFixed(0)}
            sx={{
              padding: 20,
              width: "100%",
              display: "flex",
              justifyContent: "center",
            }}
            onChange={(_, value) => {
              setPage(value);
              window.scroll(0, 450);
            }}
          />
        </StyledContainer>
      </ThemeProvider>
    );
  };

  export default CoinsTable;
